import './App.css';

function App() {

  const grid = new Array(16);
  const letters = ['A', 'B', 'C', 'D', 'E', 'F', 'G', 'H']

  for (var i = 0; i < letters.length; i++) {
    let randomIndex;
    const gridPos = grid[randomIndex];
    do {
      randomIndex = Math.floor(Math.random() * 16) + 1;
    } while (letters.findIndex((letter) => letter === gridPos) !== -1);
    grid[randomIndex] = letters[i];
  }
  console.log(grid.toString());

  return (
    <div className="App">
      <h1>Hello World</h1>
    </div>
  );
}

export default App;
